import './AboutUs.css';

export default function AboutJs() {
  return (
    <div className='AboutUs'>
        <h1 className="head-text">Xplore Local</h1>
        <h2 className="head-text2">India's First Community providing</h2>
        <h2 className="head-text2">Free city walking tour</h2>
    </div>
  )
}
